  return (
    <div className="navbar">
      <div className="navbar__title">
        <h1>Footballers Store</h1>
      </div>

      <div className="navbar__links">
        <nav>
          <Link to="/">Home</Link>
          <Link to="/store">Players</Link>
          {/* <Link to='/'>Cart</Link> */}
        </nav>
      </div>
    </div>
  );
};

export default Navbar;
